	/**
	 * Adds blank thumbnail and slide entry in slideInfo, and loading bars, and sends
	 * image upload request.
	 * @param {Event} e File input change event.
	 */
	function uploadHandler(e) {
		var notImage = 0;
		var files = e.target.files || e.dataTransfer.files;
		// for(var i = 0; i < files.length; i++) {
		Array.prototype.forEach.call(files, function(file) {
			if(file.type.slice(0, 6) !== 'image/') {
				notImage++;
				return;
			}
			var slideNum = slideInfo.length + 1;
			var id = generateId();
			slideInfo.push({
				image: undefined,
				path: 'img/placeholder-image-1.svg',
				icon_label: '',
				target_index: '-1',
				index: slideNum,
				identifier: id,
			});
			var newSlide = singleSlide({
				index:(slideInfo.length),
				path: 'img/placeholder-image-1.svg',
				identifier: id
			});
			$('.sortableThumbs').append(newSlide);
			$('li.slide-' + id + ' .actual-image').hide();
			$('li.slide-' + id + ' .nav-slide').append('<span class="load-' + id +
				' load-container"><span class="load-progress"></span></span>');

			assetAPI.onImageUpload(function(path) {
				onUploadDone(path, id);
			}, id);
			assetAPI.onImageProgress(function(progress) {
				onUploadProgress(progress, id);
			}, id);
			assetAPI.startImageUpload(file, id, true);
		});
		if(notImage > 0) {
			$('.badUpload').show();
			$('.overlay-mask').addClass('overlay-mask-visible');
		}
	}

	/**
	 * Removes progress bar and adds uploaded image.
	 * @param {string} path Path of uploaded image.
	 * @param {number} id ID of slide uploaded image belongs to.
	 */
	function onUploadDone(path, id) {
		if(path) {
			var img = new Image();
			img.src = path;
			img.className = 'fullImage';
			var slideEntry = getSlide(id);
			if(!slideEntry) {
				//This means the slide was deleted before image finished uploading.
				return;
			}
			if(currentSlide === 0) {
				selectSlide($('.nav-slide')[0]);
			}
			// Update thumbnail
			var thumb = $('li.slide-' + id + ' .actual-image');
			$('.load-' + id + ' .load-progress').width('100%');
			thumb.attr('src', path);
			thumb.load(function() {
				$(this).off('load');
				$('.load-' + id).fadeOut(400, function() {
					$('.load-' + id).remove();
					thumb.fadeIn(400);

					slideEntry.image = img;
					slideEntry.path = path;
					updateData();
					if(slideInfo[currentSlide-1].identifier === id) {
						var previewImg = $('#preview-image .drag-object')
							.fadeOut(0);
						
						$('#preview-image')
							.empty()
							.append(slideEntry.image);
						
						previewImg.fadeIn(400);
						
						$('#preview-hero')
							.fadeOut(0)
							.css({'background-image': 'url('+slideInfo[0].path+')'})
							.fadeIn(400);
					}
					orientThumbnails();
				});
			});
			if(thumb[0].complete) {
				thumb.load();
			}

			renumberThumbnails();
		}
		else {
			deleteSlide(id);
		}
	}

	/**
	 * Updates progress bar to reflect upload progress.
	 * @param {number} progress Decimal representation of upload progress.
	 * @param {number} id ID of slide image being uploaded belongs to.
	 */
	function onUploadProgress(progress, id) {
		var loadPercent = progress * 100;
		$('.load-' + id + ' .load-progress').delay(1500).width(loadPercent + '%');
		if(currentSlide === 0) { //if going from empty to 1+ slide, set first slide active
			selectSlide($('.nav-slide')[0]);
		}
	}

